import React from "react";

const SplitWindow = () => {
  return (
    <div className="flex h-screen">
      {/* Côté gauche */}
      <div className="flex-1 bg-white">
        {/* Contenu du côté gauche */}
      </div>

      {/* Côté droit */}
      <div
        style={{
          width: "561px",
          height: "1024px",
          backgroundColor: "#D9D9D9",
        }}
      >
        {/* Contenu du côté droit */}
      </div>
    </div>
  );
};

export default SplitWindow;
